import React from 'react';

const ImpactVisualizer = () => {
  return (
    <div className="impact-visualizer">
      <h2>Potential Impact</h2>
      <p>This is where the impact visualization will go.</p>
    </div>
  );
};

export default ImpactVisualizer;
